import { lazy } from "react";
import DashboardWrapper from "./DashContext";
const Dashboard = lazy(() => import("./Dashboard"));
const Slideshow = lazy(() => import("./Slideshow"));
export { Dashboard, DashboardWrapper, Slideshow };
